import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <Router>
      <ul>
        <li>Home</li>
        <li>Contato</li>
      </ul>
      <Routes>
        <Route exact path="/" elemente={<Home />} />
        <Route exact path="/company" elemente={<Company />} />
        <Route exact path="/contact" elemente={<Contact />} />
        <Route exact path="/newproject" elemente={<Company />} />
      </Routes>
      <p>Footer</p>
    </Router>
  );
}

export default App;
